import React from 'react'
import data from "./data.json"

const list = data.map((data) =>{
    return(
        <Card key= {data.product_id}>
            <Card.Body>
                <Card.Title>{data.productDescription}</Card.Title>
            </Card.Body>
        </Card>
    )
})
export default ProformaItem
